    margin-top: 5rem;
    margin-bottom: 2rem;
  }

  button {
    height: 54px;
    width: 420px;
    left: 0px;
    top: 0px;
    border-radius: 8px;
    background-color: #065BEA;
    border-radius: 8px;
    flex-direction: row;
    margin: 0.5rem;
    box-shadow: #065BEA;
    color: white;
    font-weight: 600;
    cursor: pointer;

    transition: all 0.2s ease-in;

    :hover {
      background: #0451D2;
      transform: translateY(-3px);
    }

    :active {
      background: #065BEA;
    }

    :disabled {
      background: #C6D0E0;
    }
  }
`;

const H3 = styled.div`
position: absolute;
width: 148px;
height: 28px;

font-family: 'Montserrat';
font-style: normal;
font-weight: 700;
font-size: 38px;
line-height: 28px;
/* identical to box height, or 74% */

text-transform: uppercase;

color: #000000;

`

.default = styled.div`

`

const Buttons = styled.div`
